import axios from "axios";

const CLIENTE_BASE_REST_API_URL = 'http://localhost:3000/api/v1/campistas';

class CampistaService{

    getAllCampistas(){
        return axios.get(CLIENTE_BASE_REST_API_URL);
    }

}

export default new CampistaService();
